import { StyleSheet, Text, View } from "react-native";
import React from "react";

const DeliveryAdress = () => {
  return (
    <View>
      <Text>DeliveryAdress</Text>
    </View>
  );
};

export default DeliveryAdress;

const styles = StyleSheet.create({});
